import React, { Component } from "react";
import './styled.css'

export default class Noticias extends Component {

    render() {
        return (
            <section className="feature" style={{
                backgroundSize: 'cover',
                backgroundPosition: 'center',
                backgroundImage: `url(https://portal.fgv.br/sites/portal.fgv.br/files/styles/noticia_geral/public/noticias/01/23/evento_tecnologia_da_informacao.jpg?itok=-_XRz2Xl)`
            }}>
                <div className="feature--vertical">
                    <div className="feature--horizontal">
                        <div className="feature--name">
                            FariasTech Solutions
                        </div>                       
                        <div className="feature--description">
                           A FariasTech Solutions é uma empresa de desenvolvimento de software localizada em Sorocaba, SP. Nós somos apaixonados por tecnologia e estamos comprometidos em fornecer soluções de software inovadoras e de alta qualidade para nossos clientes. Nossa equipe é composta por profissionais altamente qualificados e experientes que trabalham juntos para atender às necessidades de nossos clientes e superar suas expectativas. Nosso objetivo é ajudar nossos clientes a alcançar seus objetivos de negócios por meio de soluções de software personalizadas e eficazes. Nós nos esforçamos para entender as necessidades de nossos clientes e fornecer soluções que os ajudem a crescer e se destacar em seus mercados. Se você está procurando uma empresa de desenvolvimento de software confiável e experiente, entre em contato conosco para saber como podemos ajudá-lo.
                        </div>
                    </div>
                </div>
            </section>
        )
    }
}
